import React from "react";
import Avatar from "@mui/material/Avatar";
import { Link } from "react-router-dom";
import { IconButton } from "@mui/material";
import SettingsIcon from "@mui/icons-material/Settings";
import EditIcon from "@mui/icons-material/Edit";
import './Profile.css'

function Profile({ name, age, profilePic }) {
  return (
    <div class="profile">
      <Avatar sx={{ height: '90px', width: '90px' }} className="profile__image" alt={name} src={profilePic} />
      <h2 class = "profile__info">
        {name}, {age}
      </h2>
    </div>
  );
}

function Profiles() {
  return (
    <div class="profiles__page">
      <Profile
        name="Harry Alpha"
        age="23"
        profilePic="http://www.venmond.com/demo/vendroid/img/avatar/big.jpg"
      />
      <div className="profile__buttons">
        <IconButton className="profile__settings">
          <SettingsIcon />
        </IconButton>
        <IconButton className="profile__settings">
          <EditIcon />
        </IconButton>
      </div>
    </div>
  );
}

export default Profiles;
